import React from "react";
import PropTypes from "prop-types";

import "./Header.scss";

const Header = (props) => {
  return (
    <head className="header">
      <div>HEADER</div>
      <div>RIGHT</div>
    </head>
  );
};

Header.propTypes = {};

export default Header;
